import actions from './actions';
import getters from './getters';
import mutations from './mutations';

const state = {
    collections : [],
    countries : [],
    suppliers : [],
    list_product_options : {
        sort : 'last'
    },
    sidebar : {
        collection_id : '',
        more : false,
    },
    banners: []
};

const moduleStore = {
    namespaced: true,
    state,
    actions,
    getters,
    mutations,
}
const moduleName = 'Home'

export {
    moduleStore , moduleName
};
